import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  const navigate = useNavigate();

  const handleSignUp = () => {
    navigate('/signup'); // Adjust route if your signup page is different
  };

  const handleLogin = () => {
    navigate('/login');
  };

  return (
    <div className="landing-container">
      <header className="landing-header">
        <h1 className="landing-title">Cooking Skills Hub</h1>
        <p className="landing-subtitle">
          Share, Learn, and Master Culinary Arts Together
        </p>
      </header>
      <section className="landing-hero">
        <div className="hero-content">
          <h2 className="hero-headline">Unleash Your Inner Chef</h2>
          <p className="hero-text">
            Join a vibrant community of food enthusiasts to exchange recipes, tips, and techniques. Whether you’re a beginner or a pro, there’s a place for you here.
          </p>
          <div className="hero-buttons">
            <button className="cta-btn primary" onClick={handleSignUp}>
              Get Started
            </button>
            <button className="cta-btn secondary" onClick={handleLogin}>
              Log In
            </button>
          </div>
        </div>
        <div className="hero-image">
          {/* Placeholder for a cooking-related image */}
          <div className="image-placeholder"></div>
        </div>
      </section>
      <footer className="landing-footer">
        <p>© 2025 Cooking Skills Hub. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default LandingPage;
